create table accounts_items_bank
(
    OwnerAccountId    int          not null,
    Id                int          not null
        primary key,
    ItemId            int          not null,
    Stack             int unsigned not null,
    SerializedEffects longblob     null
)
    engine = MyISAM
    charset = utf8;

create index OwnerAccountId
    on accounts_items_bank (OwnerAccountId);

